export const TimeInput: PluginComponent<TimeInputType> = ({
  extra,
  value,
  onChange,
}) => {
  return (
    <TimePicker
      onChange={(time: any) => onChange(time)}
      value={Moment(value)}
      showSecond={false}
      format="h:mm a"
      use12Hours
      className={UI.dateInput}
      // className={inputClass}
    />
  );
};
